import React, { useEffect } from "react";
import Button from "@mui/material/Button";
import Grid from "@mui/material/Grid";
import Paper from "@mui/material/Paper";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import backgroundImage from "../assets/BackgroundImage.png";
import logo from "../assets/logo.png";
import campechana from "../assets/campechana.png";

const array = ["hola", "hola2", "hola3"];

function Home() {
  useEffect(() => {
    $('.items').slick({
      dots: true,
      infinite: true,
      speed: 800,
      autoplay: true,
      autoplaySpeed: 2000,
      slidesToShow: 4,
      slidesToScroll: 4,
      responsive: [
        {
          breakpoint: 1024,
          settings: {
            slidesToShow: 3,
            slidesToScroll: 3,
            infinite: true,
            dots: true
          }
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 2
          }
        },
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        }
      ]
    });
  }, []);

  return (
    <Box
      sx={{
        backgroundImage: `url(${backgroundImage})`,
        backgroundSize: "cover",
        minHeight: "100vh",
        flexDirection: "column",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <>
        {array.map((element) => {
          return <Button variant="text">{element}</Button>;
        })}

        <Grid container spacing={2}>
          <Grid item lg={5} md={4} xs={3}></Grid>
          <Grid item lg={2} md={4} xs={6}>
            <Paper sx={{ borderRadius: "25px", backgroundColor: "black", display: "flex", justifyContent: "center", alignItems: "center" }} elevation={5}>
              <img src={logo} alt="logo" style={{ width: "80%", height: "auto", padding: "1rem" }} />
            </Paper>
          </Grid>
          <Grid item lg={5} md={4} xs={3}></Grid>
        </Grid>


        <h1>Promociones</h1>
        <Paper sx={{
          borderRadius: "25px",
          backgroundColor: "black",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          position: "relative"
        }} elevation={5}>
          <div style={{ width: "50%", height: "100%", backgroundColor: "red", position: "absolute", left: 0 }}>

            <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
              <Grid item xs={12}>
                <h1>3 x 2</h1>
              </Grid>
              <Grid item xs={12}>
                <h2>Campechanas</h2>
              </Grid>
              <Grid item xs={12}>
                <h3>De $297 a</h3>
              </Grid>
              <Grid item xs={6}>
                <h1>$198</h1>
              </Grid>
            </Grid>

          </div>
          <img src={campechana} alt="campechana" style={{ width: "100%", height: "100%", objectFit: "cover" }} />
        </Paper>

        <div className="items">
          <div><img src="https://res.cloudinary.com/dxfq3iotg/image/upload/v1565190720/gallery/preview/02_o_car.jpg" /></div>
          <div><img src="https://res.cloudinary.com/dxfq3iotg/image/upload/v1565190715/gallery/preview/03_r_car.jpg" /></div>
          <div><img src="https://res.cloudinary.com/dxfq3iotg/image/upload/v1565190714/gallery/preview/04_g_car.jpg" /></div>
          <div><img src="https://res.cloudinary.com/dxfq3iotg/image/upload/v1565190714/gallery/preview/01_b_car.jpg" /></div>
          <div><img src="https://res.cloudinary.com/dxfq3iotg/image/upload/v1565190720/gallery/preview/02_o_car.jpg" /></div>
          <div><img src="https://res.cloudinary.com/dxfq3iotg/image/upload/v1565190715/gallery/preview/03_r_car.jpg" /></div>
          <div><img src="https://res.cloudinary.com/dxfq3iotg/image/upload/v1565190714/gallery/preview/04_g_car.jpg" /></div>
          <div><img src="https://res.cloudinary.com/dxfq3iotg/image/upload/v1565190714/gallery/preview/01_b_car.jpg" /></div>
        </div>

      </>
    </Box>
  );
}

export default Home;
